import React, { Component } from "react";
import { Tabs, Icon, Menu } from "antd";

import UserProfile from "./UserProfile/UserProfile";
import Conversations from "./Conversations/Conversations";
import Groups from "./Groups/Groups";

const TabPane = Tabs.TabPane;
const { SubMenu }  = Menu;


export class Dashboard extends Component {
  render() {
    const tabs = [
      { key: 1, title: "Profile", icon: "user", component: UserProfile },
      { key: 2, title: "Conversation", icon: "message", component: Conversations },
      { key: 3, title: "Groups", icon: "team", component: Groups }
    ];
    const tabsContent = tabs.map(tab => {
      return (
          <Menu
              onClick={this.handleClick}
              style={{ width: 256 }}
              defaultSelectedKeys={['1']}
              defaultOpenKeys={['sub1']}
              mode="inline"
          >
            <SubMenu
                key="sub1"
                title={
                  <span>
              <Icon type="mail" />
              <span>Navigation One</span>
            </span>
                }
            >
              <Menu.ItemGroup key="g1" title="Item 1">
                <Menu.Item key="1">Option 1</Menu.Item>
                <Menu.Item key="2">Option 2</Menu.Item>
              </Menu.ItemGroup>
              <Menu.ItemGroup key="g2" title="Item 2">
                <Menu.Item key="3">Option 3</Menu.Item>
                <Menu.Item key="4">Option 4</Menu.Item>
              </Menu.ItemGroup>
            </SubMenu>
            <SubMenu
                key="sub2"
                title={
                  <span>
              <Icon type="appstore" />
              <span>Navigation Two</span>
            </span>
                }
            >
              <Menu.Item key="5">Option 5</Menu.Item>
              <Menu.Item key="6">Option 6</Menu.Item>
              <SubMenu key="sub3" title="Submenu">
                <Menu.Item key="7">Option 7</Menu.Item>
                <Menu.Item key="8">Option 8</Menu.Item>
              </SubMenu>
            </SubMenu>
            <SubMenu
                key="sub4"
                title={
                  <span>
              <Icon type="setting" />
              <span>Navigation Three</span>
            </span>
                }
            >
              <Menu.Item key="9">Option 9</Menu.Item>
              <Menu.Item key="10">Option 10</Menu.Item>
              <Menu.Item key="11">Option 11</Menu.Item>
              <Menu.Item key="12">Option 12</Menu.Item>
            </SubMenu>
          </Menu>
        // <TabPane
        //   tab={
        //     <span>
        //       <Icon type={tab.icon} />
        //       {tab.title}
        //     </span>
        //   }
        //   key={tab.key}
        // >
        //   <tab.component />
        // </TabPane>
      );
    });
    return <Tabs defaultActiveKey="1">{tabsContent}</Tabs>;
  }
}

export default Dashboard;
